import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import Dashboard from './components/Dashboard';
import ExpertRegistration from './components/ExpertRegistration';
import DoctorRegistration from './components/DoctorRegistration';
import DspRegistration from './components/DspRegistration';
import WorkplaceRegistration from './components/WorkplaceRegistration';
import Accounting from './components/Accounting';
import DataImport from './components/DataImport';
import Navbar from './components/Navbar';
import './App.css';

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/dashboard" element={<><Navbar /><Dashboard /></>} />
          <Route path="/experts" element={<><Navbar /><ExpertRegistration /></>} />
          <Route path="/doctors" element={<><Navbar /><DoctorRegistration /></>} />
          <Route path="/dsps" element={<><Navbar /><DspRegistration /></>} />
          <Route path="/workplaces" element={<><Navbar /><WorkplaceRegistration /></>} />
          <Route path="/accounting" element={<><Navbar /><Accounting /></>} />
          <Route path="/data" element={<><Navbar /><DataImport /></>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
